import logo from './logo.svg';
import './App.css';

function App() {
    return ( <
        div className = "App" >
        <
        header className = "App-header" >
        <
        p >
        This is how react app works <
        /p > < /
        header >

        <
        main className = "App-body" >
        <
        a href = 'reactjs.org' > You can read documentation by clicking me < /a> <
        /main> <
        /
        div >
    );
}

export default App;
